export default function TrendingMovies() {
  return (
    <>
      <div className="text-center text-xl font-bold text-stone-900	">
        Trending Movies
      </div>
      <div>
        <div className=" flex justify-center items-end h-46 w-20  rounded bg-[url('https://ychef.files.bbci.co.uk/1280x720/p0f8jblh.jpg')] bg-contain bg-no-repeat">
          <div className="text-amber-700 py-1 bg-slate-950/50 w-full text-center	">
            John Wick
          </div>
        </div>
      </div>
    </>
  );
}
